import React from 'react';
import '../components/css/footer.css';

export default function Footer() {
    return (
        <footer id="footer">
            <p>| RG cameras | &copy; 2020, All Rights Reserved</p>
            <a target="_blank" rel="noopener noreferrer" href="https://www.facebook.com/rosmerita.lopez" className="fa fa-facebook"></a>
            <a target="_blank" rel="noopener noreferrer" href="https://twitter.com/RossmeryGarci10" className="fa fa-twitter"></a>
            <a target="_blank" rel="noopener noreferrer" href="https://www.instagram.com/rossmery_garc1a/" className="fa fa-instagram"></a>
            <a target="_blank" rel="noopener noreferrer" href="https://www.youtube.com/" className="fa fa-youtube"></a>
        </footer>
    )
}
